import React from 'react';
import PropTypes from 'prop-types';
import './AssetAttributesInfo.scss';
import { isValidData } from '../../utils/common';

const AssetAttributesInfo = props => {
  const { Data } = props;
  if (isValidData(Data)) {
    let values = [];
    if (Data && Data.values) {
      values = Data.values.map(value => {
        return <div key={value.id}>{value.name}</div>;
      });
    }
    return (
      <div className="card border">
        <div className="card-body">
          <p className="header"> Values : </p>
          {values}
        </div>
      </div>
    );
  }
  return null;
};

AssetAttributesInfo.propTypes = {
  Data: PropTypes.object
};

AssetAttributesInfo.defaultProps = {
  Data: {}
};
export default AssetAttributesInfo;
